import React, { Component } from "react";
import {
  TextField,
  Container,
  Button,
  Tabs,
  Tab,
  TabPanel
} from "@material-ui/core";

export default class Lgon extends Component {
  TextFieldStyle = {};

  render() {
    return (
      <div>
        <Tabs>
          <Tab value={0} label="LOGIN"></Tab>
          <Tab value={1} label="REGISTER"></Tab>
        </Tabs>
        <TabPanel value={0}></TabPanel>
        <h2>LOGIN</h2>
      </div>
    );
  }
}
